(5510, 7711, 'DTJ.FrezDIA D=50 I=30 S=25 Z=4+4 LH', 'DTJ.FrezDIA D=50 I=30 S=25 Z=4+4 LH', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Tělo ze speciální tvrdé oceli nebo DENSIMETU</li>\\n<li>Výška břitu PCD 4,5 mm</li>\\n<li>Možnost ostření 5-6 krát</li>\\n<li>Úhel axiálních lopatek 54,9°</li>\\n<li>Struktura symetrická nebo asymetrická</li>\\n</ul>\\n<p><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/54,9.jpg\\\" alt=\\\"\\\" width=\\\"388\\\" height=\\\"68\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<div><span>Využití na CNC strojích pro řezání a formátování materiálů, jako je dřevo, DTD jednostranná a oboustranná LTD, potažená fólií melamin, MDF, HPL, CORIAN.</span></div>\\n<div>\\n<h3>VÝHODY:</h3>\\n<p><span>Velmi dobrá povrchová úprava obrobku, tichý provoz nástroje </span><span>při vysokých otáčkách.</span></p>\\n</div>\\n<p></p>\\n<div><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/54,9%20graf.jpg\\\" alt=\\\"\\\" width=\\\"456\\\" height=\\\"300\\\" /></div>\\n<div><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/DTA%20(Z1+1)%20LH%20(2).jpg\\\" alt=\\\" width=\\\" 550=\\\"\\\" height=\\\"141\\\" /></div>\\n<p></p>\\n<h3>NÍŽE V', '_vyr_771165A34EE443020D78E3C016161873809F.jpg', 0, '35640.00', '0.00', 'DTJ.50.030.25.1SL4', '_vyrn_771165A34EE443020D78E3C016161873809F.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-7-0-0|2-7-46-0|2-7-46-585|10-0-0-0|10-474-0-0|10-474-546-0|10-474-546-555', '2021-01-08 11:21:39', '2021-01-08 11:21:39'),
