(5528, 7735, 'Pilový kotouč D250mm / Z80 / F30mm', 'Pilový kotouč D250mm / Z80 / F30mm', '<p><strong>Použití:</strong></p>\\n<p>Tento pilový kotouč je velmi vhodný pro formátovací řezy materiálu, jako je lamino či dřevotříska. Dokáže vytvořit perfektní finální řez díky jeho tvarovaným zubům.</p>\\n<p><strong>Stroje:</strong></p>\\n<p>Pilový kotouč je vhodný zejména pro stolní pily, horizontální a vertikální formátovací stroje.</p>\\n<p><strong>Materiál:</strong></p>\\n<p>Kotouč můžete použít ideálně pro práci s jednostranně či oboustranně laminovanými deskami, DTD, HPL.</p>', '_vyr_7735_vyr_2057P15-250030080-00W_P15-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', 0, '1786.00', '0.00', 'P15.250030080.000', '_vyrn_7735_vyr_2057P15-250030080-00W_P15-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', '_vyrp11_7735_vyrp11_2057P15-250030080-00W_P15-250030080-00W_2-20-20-20-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', '_vyrp12_7735_vyrp11_2057P15-250030080-00W_P15-250030080-00W_2-20-20-20-20-20-20-20-20-20-20-20-20-20-20ITA-1.jpg', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-2-0-0|2-2-20-0|2-7-0-0|2-7-47-0', NULL, '2020-10-01 12:04:56'),
