(5553, 7760, 'Drážkovací fréza žiletková (D=30; I=50; S=20; Z2+1) HW', 'Drážkovací fréza žiletková (D=30; I=50; S=20; Z2+1) HW', '<p>- Fréza pro frézování drážek, falců a zavrtávání<br />- Určeno pro CNC a ruční obrábění dřeva, lamina a HPL<br />- Kvalitní vytvoření drážky nebo oříznutí materiálu</p>\\n<p>Drážkovací stopková fréza s jednou zavrtávací žiletkou a dvěmi řezacími žiletkami. Má vynikající vlastnosti při zavrtávání v tvrdém dřevě a deskových materiálech (lamino, dřevotříska, MDF, HDF a Corian). Stopka průměru 12 mm je určena pro upnutí v CNC obráběcích centrech při vysokých posuvových rychlostech. Lze použít také pro ruční frézování. </p>', '_vyr_7760_vyr_96Drazkovaci-freza-Griani-Z2-1.jpg', 0, '3780.00', '0.00', '1333005008', '_vyrn_7760_vyr_96Drazkovaci-freza-Griani-Z2-1.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-1-11-0|2-7-43-0|14-0-0-0|14-610-0-0', NULL, '2020-10-01 12:04:56'),
