(5558, 7765, 'Freza spirálová (D=16; I=55; S=16 ;Z=3) RH, DIA povlakovaná', 'Freza spirálová (D=16; I=55; S=16 ;Z=3) RH, DIA povlakovaná', '<div><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/nadia.jpg\\\" alt=\\\"\\\" width=\\\"303\\\" height=\\\"92\\\" /></div>\\n<div></div>\\n<div>\\n<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Z3 - 3 spirálovitě uložené břity</li>\\n<li>Tělo ze speciálního tvrdého materiálu HM o tvrdosti 93,8 HRA</li>\\n<li>NaDia několikanásobně zvyšuje životnost HM</li>\\n<li>Snižuje tření při frézování</li>\\n<li>Snižuje zahřívání</li>\\n</ul>\\n<h3>POUŽITÍ:</h3>\\n<ul>\\n<li>Určeno pro všechny CNC stroje a ruční frézky pro měkké i tvrdé masivní dřevo</li>\\n</ul>\\n<h3>DIA SPIRÁLOVÉ FRÉZY:</h3>\\n<p><span>Diamantový </span>povlak (DLC) je výsledkem procesu PECVD, který je jednou z nejnovějších technologií povlakování. Celková tloušťka povlaku 1 mikron dosahuje velmi odolného povrchu a nekorozní prostředí. Z provedených testů vyplývají velmi dobré výsledky, které potvrzují zvýšení životnosti řezných nástrojů až o 300 %.</p>\\n</div>', '_vyr_7765193-160-11XTR_193-160-11XTR.jpg', 0, '4612.80', '0.00', '193.160.11XTR', '_vyrn_7765193-160-11XTR_193-160-11XTR.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-1-11-0|2-1-11-313|2-7-0-0|2-7-45-0|2-7-45-597|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2020-10-01 12:04:56'),
