(5568, 7776, 'Drážkovací fréza žiletková (D=18; I=20; S=12) HW', 'Drážkovací fréza žiletková (D=18; I=20; S=12) HW', '<p>Drážkovací stopková fréza s řeznými žiletkami. Má vynikající vlastnosti při drážkování v tvrdém dřevě a deskových materiálech (lamino, dřevotříska, MDF a Corian). Fréza je určena pro ruční frézování, ale je použitelná také v CNC obráběcích centrech upnutím do kleštiny.<br /><br />Fréza je vybavena zavrtávací žiletkou, která usnadňuje zavrtávání do materiálu.</p>\\n<p>Specifikace:</p>\\n<p>- Drážkování, ořezávání</p>\\n<p>- Ruční frézování, CNC</p>\\n<p>- MAN, MEC</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_7776_vyr_125221_BRIANI.jpg', 0, '1435.00', '0.00', '22118001200', '_vyrn_7776_vyr_125221_BRIANI.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-1-11-0|2-7-0-0|2-7-43-0|14-0-0-0|14-610-0-0', NULL, '2020-10-01 12:04:57'),
