(5601, 7819, 'Předřezový skládaný kotouč DSC.070020016.004', 'DIA předřezový skládaný kotouč', '<h3><strong>Použití:</strong></h3>\\n<p>Ideální pro formátování odolných materiálů. Velkou výhodou je možné použití pro příčné nebo podélné formátování. Předřezový kotouč má až 50× delší výdrž než HW kotouče díky speciálnímu polykrystalickému diamantovému zubu.</p>\\n<p>Tím pádem tento kotouč disponuje naprosto bezkonkurenčně<span> </span><strong>nejlepším poměrem<span> </span><em>kvalita/cena/výkon!</em></strong> </p>\\n<h3><strong>Stroje:</strong></h3>\\n<p>Velice vhodné je použití tohoto kotouče na strojích jako jsou stolní pily, horizontální a vertikální formátovací stroje či CNC pily vybavené předřezovým agregátem s možností nastavení výšky řezu.</p>\\n<h3><strong>Materiál:</strong></h3>\\n<p>Předřezový kotouč lze velmi dobře využít při formátování jednostranně nebo oboustranně laminovaných desek, DTD, MDF, HPL.</p>\\n<div></div>\\n<h3><strong>PODROBNÁ SPECIFIKACE VŠECH PŘEDŘEZOVÝCH KOTOUČŮ:</strong></h3>\\n<table border=\\\"3\\\" cellpadding=\\\"1\\\" width=\\\"100%\\\" height=\\\"285\\\">\\n<tbody>\\n<tr>', '_vyr_7819DSC-070020016-006_DSC_ITATOOLSOUT.jpg', 0, '8022.00', '0.00', 'DSC.070020016.004', '_vyrn_7819DSC-070020016-006_DSC_ITATOOLSOUT.jpg', '', '', '', 21, 1, 0, 0, '', 0, '10-0-0-0|2-0-0-0|2-2-0-0|2-2-20-0|2-2-20-356|2-7-0-0|2-7-47-0|2-7-47-563|10-475-0-0|10-475-561-0', NULL, '2020-10-01 12:04:57'),
