(5954, 8188, 'Kotouč pro zásmolky D100x8 d22 Z4 R30 HM', ' Kotouč pro zásmolky D100x8 d22 Z4 R30 HM', '<p>Nový 100 mm CMT kotouč na zásmolky s teflonovým oranžovým povrchem je vyroben z jakostní oceli. Tělo je osazeno 4 tvrdokovovými zuby, které garantují dlouhou životnost. D100x22x8 R30mm Z4. Určeno pro lamelovací frézky</p>', '101456_8188__vyr_66C240-lodickovaci-kotouc.jpg', 0, '1771.00', '1968.00', '240.004.04', '101456_8188__vyrn_66C240-lodickovaci-kotouc.jpg', '', '', '', 21, 1, 2, 1, '', 0, '2-2-286-0|2-2-0-0|2-2-287-0', NULL, '2020-10-01 12:04:59'),
(5955, 8189, '355 Vrták kolíkovací neprůchozí s vodícím hrotem - D3x25 S=10x30 L57 HWM, RH', '355 Vrták kolíkovací neprůchozí s vodícím hrotem - D3x25 S=10x30 L57 HWM, RH', '<p><span> </span>Tělo vrtáku z vysoce kvalitního monolitu usazeného do stopky z tvrzené oceli. <br />- Hrot vrtáku s přesně vycentrovaným středicím hrotem. <br />- Kvalitní předřezy a vodícím hrotem radiálním podbroušením (V2). <br />- 2 spiralové drážky a dvě odlehčovací. <br />- Válcová upínací stopka s unášecí plochou a šroubem pro nastavení délky.  <br />- Přesně broušená stopka pro přesné upnutí ve stroji. </p>\\r\\n<p><br />Použití: na vrtacích strojích a kolíkovačkách pro vrtání neprůchozích otvorů do DTD, MDF, lamina, HPL a plastů.</p>\\r\\n<p>- RH - pravotočivé provedené - černá barva vrtáku</p>\\r\\n<p>- LH - levotočivé provedení - označeno červenou barvou</p>\\r\\n<p>- HWM - celotvrdokov</p>', '_vyr_8189vrtak-kolik.jpg', 1, '540.72', '0.00', '', '_vyrn_8189vrtak-kolik.jpg', '_vyrp11_8189vrtak-kolik1.jpg', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-372-0-0|2-372-391-0', NULL, '2020-10-01 12:04:59'),
