(5968, 8203, 'Fréza DIA ( D=18; l=35; S=20; Z=3+1) RH', 'Fréza DIA ( D=18; l=35; S=20; Z=3+1) RH', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Tělo ze speciální tvrdé oceli nebo DENSIMETU</li>\\n<li>Dva celistvé PCD břity rozprostřené do tří spirál</li>\\n<li>Výška břitu PCD:\\n<ul>\\n<li>D = 12 / H = 2,5 (2 - 3 ostření)</li>\\n<li>D = 16 - 18 / H = 4 (5 - 6 ostření)</li>\\n<li>D = 20 - 25 / H = 4,5 (5 - 6 ostření)</li>\\n</ul>\\n</li>\\n<li>Čelní PCD břit pro zavrtání</li>\\n</ul>\\n<p><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/dte.jpg\\\" alt=\\\"\\\" width=\\\"537\\\" height=\\\"126\\\" style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<div>Určeno pro všechny CNC stroje a ruční frézky pro spojování a frézování dřevotřískových desek, LTD, MDF a kompozitu na bázi dřeva, HPL, tvrdého dřeva, překližky.</div>\\n<div>\\n<h3>VÝHODY:</h3>\\n<p>Vysoká rychlost posuvu, výborná čistota ofrézované hrany a tichý provoz.</p>\\n</div>\\n<p></p>\\n<div><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/dte%20graf.jpg\\\" alt=\\\"\\\" width=\\\"508\\\" height=\\\"338\\\" style=\\\"display: bloc', '_vyr_8203DTE.jpg', 0, '8505.00', '8977.50', 'DTE.18.035.20.0SR', '_vyrn_8203DTE.jpg', '', '', '', 21, 1, 0, 0, '', 0, '10-0-0-0|2-0-0-0|2-1-0-0|2-7-0-0|2-7-46-0|2-7-46-583|10-474-0-0|10-474-518-0|10-474-518-538', NULL, '2020-10-01 12:04:59'),
